Explanation:

- The controller method destroy(Post $post) sets the post's thumbnail_id to null and then returns a RedirectResponse: redirect()->route('admin.posts.edit', $post)->withSuccess(...).
- Laravel redirect()->route(...) returns an HTTP redirect (by default 302 Found) with a Location header pointing to the resolved route URL (the admin.posts.edit page for the given post). The response also carries a flashed success message in session, but that is not part of the HTTP body structure.
